class BuyList extends Component {
  render() {
    const lists = [
      { id: 1, name: "とまと" },
      { id: 2, name: "とまと" },
      { id: 1, name: "とまと" },
      { id: 1, name: "とまと" }
  ];
    return <h1>This is from BuyList</h1>;
  }
}

export default BuyList;
